def solve(str):
    input_string=int(str, 2);
 
    #Obtain the total number of bytes
    Total_bytes= (input_string.bit_length() +7) // 8
 
    #Convert these bits to bytes
    input_array = input_string.to_bytes(Total_bytes, "big")
 
    #Convert the bytes to an ASCII value and display it on the output screen
    ASCII_value=input_array.decode()
    return ASCII_value


def get_ASCII(string):

    arr = textwrap.wrap(string, 7)

    ASCII_value = ''

    for i in range(len(arr)):
        ASCII_value += solve(arr[i])

    return ASCII_value

def f(letter, key):
    if (letter.islower()):
        index = ord(letter)-97
    elif(letter.isupper()):
        index = ord(letter)-65
    mapping = (index-key) % 26
    if (letter.islower()):
        return chr(mapping+97)
    elif (letter.isupper()): 
        return chr(mapping+65)
     

def caeser(key,plain):

    arr = np.array(list(plain))

    arr = np.array([f(xi, key) for xi in arr])

    return np.array2string(arr)



def cipher_solver(question):

    decoded = base64.b64decode(question+"===========================")

    decoded = decoded.decode('utf-8')

    decoded = decoded[1:len(decoded)-1]

    extracted_data = re.split(',', decoded)
    decimal = int(extracted_data[1], 2)
    new_string = get_ASCII(extracted_data[0])
    

    return caeser(decimal, new_string)




